query BlogTemplate(
  $id: String!
) {
  contentfulBlog(id: {eq: $id}) {
    title
    id
    slug
    content {
      childMarkdownRemark {
        html
      }
    }
    seoTitle
    seoDescription
    seoAuthor
    seoKeywords
    seoImage {
      fluid(maxWidth: 1200, quality: 100) {
        ...GatsbyContentfulFluid
        src
      }
    }
    featuredImage {
      fluid(maxWidth: 1200, quality: 100) {
        ...GatsbyContentfulFluid
        src
      }
    }
  }
}

fragment GatsbyContentfulFluid on ContentfulFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

query ArchiveQuery(
  $skip: Int!
  $limit: Int!
) {
  allContentfulBlog(sort: {fields: [createdAt], order: DESC}, filter: {node_locale: {eq: "en-US"}}, skip: $skip, limit: $limit) {
    edges {
      node {
        id
        slug
        title
        createdAt
        categories {
          category
          id
        }
        featuredImage {
          fluid(maxWidth: 1200, quality: 85) {
            src
            ...GatsbyContentfulFluid
          }
        }
      }
    }
  }
}

